import React from "react";
import { Row, Col } from "antd";

const Story = () => {
  return (
    <div className="story">
      <Row gutter={24}>
        <Col xs={24} lg={4}>
          <div className="story-details"></div>
        </Col>
      </Row>
    </div>
  );
};

export default Story;
